import React, { useEffect, useMemo, useState } from "react";
import { eventAPI } from "../services/api"; // your existing axios wrapper

import MemberProfileCard from "./MemberProfileCard";
import MetricsOverview from "./MetricsOverview";
import JourneyTimeline from "./JourneyTimeline";
import ConversationLog from "./ConversationLog";

export default function Dashboard() {
  const [profile, setProfile] = useState(null);
  const [metrics, setMetrics] = useState(null);
  const [journey, setJourney] = useState([]);
  const [conversations, setConversations] = useState([]);

  const [loading, setLoading] = useState(true);
  const [err, setErr] = useState("");

  useEffect(() => {
    let isMounted = true;

    (async () => {
      try {
        setLoading(true);
        const [pRes, mRes, jRes, cRes] = await Promise.all([
          eventAPI.getMemberProfile(),
          eventAPI.getMetrics(),
          eventAPI.getJourney(),
          eventAPI.getConversations(),
        ]);

        if (!isMounted) return;

        setProfile(pRes?.data ?? null);
        setMetrics(mRes?.data ?? null);

        // Ensure journey is an array
        const j = Array.isArray(jRes?.data) ? jRes.data : [];
        setJourney(j);

        // conversations endpoint returns flat array; if backend returns episodes, flatten
        let conv = [];
        const cd = cRes?.data;
        if (Array.isArray(cd)) {
          if (cd.length && typeof cd[0] === "object" && "conversations" in cd[0]) {
            // journey-like
            cd.forEach((ep) => {
              conv = conv.concat(ep?.conversations || []);
            });
          } else {
            conv = cd;
          }
        }
        setConversations(conv);
        setErr("");
      } catch (e) {
        console.error(e);
        setErr(e?.message || "Failed to load data");
      } finally {
        if (isMounted) setLoading(false);
      }
    })();

    return () => {
      isMounted = false;
    };
  }, []);

  const totals = useMemo(() => {
    const msg = (journey || []).reduce(
      (acc, ep) => acc + (ep?.metrics?.messages || (ep?.conversations?.length || 0)),
      0
    );
    const decisions = (journey || []).reduce((acc, ep) => acc + (ep?.metrics?.decisions || 0), 0);
    return { msg, decisions };
  }, [journey]);

  if (loading) {
    return (
      <div style={page}>
        <div style={loadingBox}>Loading dashboardâ€¦</div>
      </div>
    );
  }

  if (err) {
    return (
      <div style={page}>
        <div style={errorBox}>Error: {err}</div>
      </div>
    );
  }

  return (
    <div style={page}>
      <div style={gridTop}>
        <MemberProfileCard profile={profile} />
        <div style={kpiCard}>
          <div style={{ display: "grid", gridTemplateColumns: "1fr 1fr", gap: 16 }}>
            <KPI label="Total Messages" value={totals.msg} />
            <KPI label="Decisions Logged" value={totals.decisions} />
          </div>
          <div style={{ marginTop: 12 }}>
            <MetricsOverview metrics={metrics} />
          </div>
        </div>
      </div>

      <div style={gridBottom}>
        <JourneyTimeline journey={journey} />
        <ConversationLog conversations={conversations} />
      </div>
    </div>
  );
}

function KPI({ label, value }) {
  return (
    <div style={{ border: "1px solid #e2e8f0", borderRadius: 10, padding: 12 }}>
      <div style={{ fontSize: 12, color: "#64748b", marginBottom: 6 }}>{label}</div>
      <div style={{ fontWeight: 700, fontSize: 22 }}>{value ?? 0}</div>
    </div>
  );
}

const page = { padding: 16, background: "#f1f5f9", minHeight: "100vh" };
const loadingBox = {
  background: "#fff",
  border: "1px solid #e2e8f0",
  borderRadius: 12,
  padding: 16,
};
const errorBox = {
  background: "#fff0f0",
  border: "1px solid #fecaca",
  borderRadius: 12,
  padding: 16,
  color: "#7f1d1d",
};
const gridTop = { display: "grid", gridTemplateColumns: "1.2fr 2fr", gap: 16, marginBottom: 16 };
const gridBottom = { display: "grid", gridTemplateColumns: "1.5fr 1fr", gap: 16 };
const kpiCard = { background: "#fff", border: "1px solid #e2e8f0", borderRadius: 12, padding: 16 };
